import SignUp from '../pages/signup.page';
import { expect } from 'chai';


describe("Performing a search operation on MyStore", function () {
    it("It should open page", function () {
        SignUp.open('http://automationpractice.com/index.php?controller=authentication&back=my-account#account-creation');
    });

    it("It click sign in", function () {
        SignUp.loginbuton.click();
        browser.pause(5000);

    });

    it("It enter value in email", function () {
        SignUp.EmailCreate.click();
        SignUp.EmailCreate.setValue("as@aa.com");
        browser.pause(3000);
        SignUp.CreateButton.click();
        browser.pause(3000);
    });

    it(`It should show log`, function () {
        SignUp.passwordInputReal.click();
        SignUp.EmailInput.click();
        SignUp.passwordInputReal.click();
        browser.pause(3000);
        SignUp.getAttributeCommand();
        browser.pause(5000);
        //expect(SignUp.passwordInput).toHaveAttr('class', 'required password form-group form-error')
        expect(SignUp.passwordInput).toHaveElementClass('class', { message: 'required password form-group form-error', })
        });
    });

